import React, {FC} from 'react';
import styled from 'styled-components'


export const ActionButton = styled.button`
height: 4em;
  width: 4em;
  border-radius: 50%;
  border: none;
  box-shadow: 0 1em 2em rgba(0, 0, 0, 0.274);
  color: white;
  font-size: 2em;
`

export const AddIncomeButton = styled(ActionButton)`
  background: green;

`

export const AddExpenseButton = styled(ActionButton)`
background: red;
`

export const MainContent = styled.main`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 100vh;
  width: 100vw;

`

export const ActionButtonsWrapper = styled.section`
  display: flex;

`

const App: FC = () => {
 return (
 <MainContent>
  <h1>hello world</h1>
  <ActionButtonsWrapper>
    <AddExpenseButton>-</AddExpenseButton>
    <AddIncomeButton>+</AddIncomeButton>
  </ActionButtonsWrapper>
 </MainContent>
 )

}

export default App;
